import "../App.css";
import React from "react";
import ForecastInfo from "../Components/ForecastInfo";

function Forecast(props) {
  return (
    <div style={props.background} className="forecast">
      {props.forecastTemp[0]};
      <ForecastInfo />
    </div>
  );
}

export default Forecast;
